import React,{useState} from "react";
import AddTodo from "../AddTodo/AddTodo";
import "./Home.css";
function Home() {
  const [show, setShow] = useState(false);
  return (
      <>
      <div className="container">
        <input type="text" className="search mt-5" placeholder="search . . ."/>
        <button type="button" className="btn btn-warning ms-2 mb-2">Search</button>
        <button onClick={() => setShow(true)}>Show AddTodo</button>
        {show && <AddTodo show={show} setShow={setShow} />}
      </div>
    </>
  );
}

export default Home;
